import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import HomePage from './home/home';
import Registration from './registration/registration';
import Course from './courses/course';
import RunningCourses from './running_courses/running_courses';
import Instructors from './instructors/instructors';
import RunningCourse from './running_courses/running_course/running_course';
import Instructor from './instructors/instructor/instructor';
import ErrorPage from '../../ErrorPage';


const Dashboard = () => {
    return (
        <Router>
            <Routes>
                <Route exact path="/home" element={<HomePage />} />
                <Route exact path="/home/registration" element={<Registration />} />
                <Route exact path="/course/:id" element={<Course />} />
                <Route exact path="/course/running/:dept_name" element={<RunningCourse />} />
                <Route exact path="/course/running" element={<RunningCourses />} />
                <Route exact path="/instructor" element={<Instructors />} />
                <Route exact path="/instructor/:id" element={<Instructor />} />
                <Route exact path="*" element={<ErrorPage />} />
            </Routes>
        </Router>
        )
}

export default Dashboard;
